import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import { useAuth } from "./context/AuthContext"; // Import useAuth
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import Explore from "./pages/Explore";
import AdBooking from "./pages/AdBooking";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import UserDashboard from "./pages/UserDashboard";
import AdSummary from "./pages/AdSummary";
import Footer from "./components/Footer";
import Welcome from "./pages/Welcome";
import NewspaperLayout from "./pages/layouts/NewspaperLayout";
import DeccanChroniclesBooking from "./pages/layouts/DeccanChroniclesBooking";
import PaymentPage from "./pages/PaymentPage";
import AboutUs from './pages/AboutUs';
import Contact from './pages/Contact';
import AdminAdManagement from './components/admin/AdminAdManagement';

function App() {
  const { user, loading } = useAuth(); // Get user and loading state from context

  if (loading) {
    return <div>Loading...</div>; // Show loading state while checking auth
  }

  return (
    <Router>
      <Routes>
        {/* Pages that include Navbar and Footer */}
        <Route
          path="/*"
          element={
            <>
              <Navbar />
              <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/explore" element={<Explore />} />
                <Route 
                  path="/book-ad" 
                  element={user ? <AdBooking /> : <Navigate to="/login" />} 
                />
                <Route 
                  path="/dashboard" 
                  element={user ? <UserDashboard /> : <Navigate to="/login" />} 
                />
                <Route 
                  path="/ad-summary" 
                  element={user ? <AdSummary /> : <Navigate to="/login" />} 
                />
                <Route path="/about" element={<AboutUs />} />
                <Route path="/contact" element={<Contact />} />
                <Route 
                  path="/login" 
                  element={user ? <Navigate to="/dashboard" /> : <Login />} 
                />
                <Route 
                  path="/signup" 
                  element={user ? <Navigate to="/dashboard" /> : <Signup />} 
                />
                <Route path="/welcome" element={<Welcome />} />
                <Route 
                  path="/payment" 
                  element={user ? <PaymentPage /> : <Navigate to="/login" />} 
                />
                <Route 
                  path="/admin" 
                  element={user?.role === 'admin' ? <AdminAdManagement /> : <Navigate to="/" />} 
                />
              </Routes>
              <Footer />
            </>
          }
        />

        {/* Standalone Newspaper Layout Page (Without Navbar & Footer) */}
        <Route path="/newspaper-layout" element={<NewspaperLayout />} />

        {/* Deccan Chronicles Ad Booking Page */}
        <Route path="/deccan-chronicles-booking" element={<DeccanChroniclesBooking />} />
      </Routes>
    </Router>
  );
}

export default App;
